import React, { Component } from 'react'
import PostData from './data.json';
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import ButtonBase from "@material-ui/core/ButtonBase";
import './readJSON.css';
import Logo from './images/myhome.svg'
import Chip from '@material-ui/core/Chip';


class filter extends Component{

    render(){

        const data = [...PostData];

        const handleClick = () => {
            console.info('You clicked the Chip.');
        };

        return(
            <div>
                {PostData.map((postDetail) => {
                    return(
                        <Paper>
                            <Grid className = "Grid">
                                {postDetail.languages.map((PostLanguages)=>{
                                    const uniqueNames = Array.from(new Set(PostLanguages));
                                    return <Chip className ="chip" label={uniqueNames} variant="outlined" />
                                })}
                            </Grid>
                        </Paper>
                    )
                })}
            </div>
        )
    }
}

export default filter;
